import { Component, OnInit } from '@angular/core';
import { HttpResponse } from '@angular/common/http';
import { UntypedFormBuilder } from '@angular/forms';
import { ActivatedRoute } from '@angular/router';
import { Observable } from 'rxjs';
import { finalize } from 'rxjs/operators';

import { IAdminFeesPrice, AdminFeesPrice } from '../admin-fees-price.model';
import { AdminFeesPriceService } from '../service/admin-fees-price.service';

@Component({
  selector: 'jhi-admin-fees-price-update',
  templateUrl: './admin-fees-price-update.component.html',
})
export class AdminFeesPriceUpdateComponent implements OnInit {
  isSaving = false;

  editForm = this.fb.group({
    id: [],
    feesOrganisator: [],
    feesSupplier: [],
    feesService: [],
    feesOrganizations: [],
  });

  constructor(
    protected adminFeesPriceService: AdminFeesPriceService,
    protected activatedRoute: ActivatedRoute,
    protected fb: UntypedFormBuilder
  ) {}

  ngOnInit(): void {
    this.activatedRoute.data.subscribe(({ adminFeesPrice }) => {
      this.updateForm(adminFeesPrice);
    });
  }

  previousState(): void {
    window.history.back();
  }

  save(): void {
    this.isSaving = true;
    const adminFeesPrice = this.createFromForm();
    if (adminFeesPrice.id !== undefined) {
      this.subscribeToSaveResponse(this.adminFeesPriceService.update(adminFeesPrice));
    } else {
      this.subscribeToSaveResponse(this.adminFeesPriceService.create(adminFeesPrice));
    }
  }

  protected subscribeToSaveResponse(result: Observable<HttpResponse<IAdminFeesPrice>>): void {
    result.pipe(finalize(() => this.onSaveFinalize())).subscribe(
      () => this.onSaveSuccess(),
      () => this.onSaveError()
    );
  }

  protected onSaveSuccess(): void {
    this.previousState();
  }

  protected onSaveError(): void {
    // Api for inheritance.
  }

  protected onSaveFinalize(): void {
    this.isSaving = false;
  }

  protected updateForm(adminFeesPrice: IAdminFeesPrice): void {
    this.editForm.patchValue({
      id: adminFeesPrice.id,
      feesOrganisator: adminFeesPrice.feesOrganisator,
      feesSupplier: adminFeesPrice.feesSupplier,
      feesService: adminFeesPrice.feesService,
      feesOrganizations: adminFeesPrice.feesOrganizations,
    });
  }

  protected createFromForm(): IAdminFeesPrice {
    return {
      ...new AdminFeesPrice(),
      id: this.editForm.get(['id'])!.value,
      feesOrganisator: this.editForm.get(['feesOrganisator'])!.value,
      feesSupplier: this.editForm.get(['feesSupplier'])!.value,
      feesService: this.editForm.get(['feesService'])!.value,
      feesOrganizations: this.editForm.get(['feesOrganizations'])!.value,
    };
  }
}
<div class="row justify-content-center">
  <div class="col-8">
    <form name="editForm" role="form" novalidate (ngSubmit)="save()" [formGroup]="editForm">
      <h2
        id="jhi-admin-fees-price-heading"
        data-cy="AdminFeesPriceCreateUpdateHeading"
        jhiTranslate="createyoureventApp.adminFeesPrice.home.createOrEditLabel"
      >
        Create or edit a Admin Fees Price
      </h2>

      <div>
        <jhi-alert-error></jhi-alert-error>

        <div class="form-group" [hidden]="editForm.get('id')!.value == null">
          <label class="form-control-label" jhiTranslate="global.field.id" for="field_id">ID</label>
          <input type="number" class="form-control" name="id" id="field_id" data-cy="id" formControlName="id" [readonly]="true" />
        </div>

        <div class="form-group">
          <label class="form-control-label" jhiTranslate="createyoureventApp.adminFeesPrice.feesOrganisator" for="field_feesOrganisator"
            >Fees Organisator</label
          >
          <input
            type="number"
            class="form-control"
            name="feesOrganisator"
            id="field_feesOrganisator"
            data-cy="feesOrganisator"
            formControlName="feesOrganisator"
          />
        </div>

        <div class="form-group">
          <label class="form-control-label" jhiTranslate="createyoureventApp.adminFeesPrice.feesSupplier" for="field_feesSupplier"
            >Fees Supplier</label
          >
          <input
            type="number"
            class="form-control"
            name="feesSupplier"
            id="field_feesSupplier"
            data-cy="feesSupplier"
            formControlName="feesSupplier"
          />
        </div>

        <div class="form-group">
          <label class="form-control-label" jhiTranslate="createyoureventApp.adminFeesPrice.feesService" for="field_feesService"
            >Fees Service</label
          >
          <input
            type="number"
            class="form-control"
            name="feesService"
            id="field_feesService"
            data-cy="feesService"
            formControlName="feesService"
          />
        </div>

        <div class="form-group">
          <label class="form-control-label" jhiTranslate="createyoureventApp.adminFeesPrice.feesOrganizations" for="field_feesOrganizations"
            >Fees Organizations</label
          >
          <input
            type="number"
            class="form-control"
            name="feesOrganizations"
            id="field_feesOrganizations"
            data-cy="feesOrganizations"
            formControlName="feesOrganizations"
          />
        </div>
      </div>

      <div>
        <button type="button" id="cancel-save" data-cy="entityCreateCancelButton" class="btn btn-secondary" (click)="previousState()">
          <fa-icon icon="ban"></fa-icon>&nbsp;<span jhiTranslate="entity.action.cancel">Cancel</span>
        </button>

        <button
          type="submit"
          id="save-entity"
          data-cy="entityCreateSaveButton"
          [disabled]="editForm.invalid || isSaving"
          class="btn btn-primary"
        >
          <fa-icon icon="save"></fa-icon>&nbsp;<span jhiTranslate="entity.action.save">Save</span>
        </button>
      </div>
    </form>
  </div>
</div>
